import React, { useState, useEffect } from 'react';
import api from './services/api'

import './App.scss';

const App = () => {
  const [data, setData] = useState([])

  useEffect(() => {
    api.get('/data')
      .then((res) => console.log(res))
      .catch(err => console.log('Error -->', err))
  }, [])

  // console.log(data)
  return (
    <div className="app">
      {
        data.map((d) => <span>{d.name}</span>)
      }
      <span>Oi</span>
    </div>
  )
}

export default App;
